// Picture.js
import React from "react";

const Picture = ({ data }) => {
  return (
    <div className="picture">
      <p>
        <a href={data.photographer_url}>{data.photographer}</a>
      </p>
      <div className="imageContainer">
        <img src={data.src.large} alt="img" />
      </div>
      {/* <button type="button" href={data.src.large}>
        <img src="https://img.icons8.com/material-sharp/96/000000/download--v1.png" />
      </button> */}
      <a href="https://icons8.com/icon/83988/download">
        Download icon by Icons8
      </a>
      <div className="download">
        <p>
          <a target="_blank" href={data.src.large}>
            Download
          </a>
        </p>
      </div>
    </div>
  );
};

export default Picture;
